// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Proveedores from './components/Proveedores';
import AgregarProveedor from './components/AgregarProveedor';  // Asegúrate de tener este componente

const App = () => {
  return (
    <Router>
      <div>
        <Switch>
          <Route path="/proveedores" component={Proveedores} />
          <Route path="/agregar-proveedor" component={AgregarProveedor} />
        </Switch>
      </div>
    </Router>
  );
};

export default App;
